import { useEffect} from "react";
import "./Home.css";
import { useDispatch, useSelector } from "react-redux";
import { fetchDashboardStats, fetchRevenue } from "../redux/dashboardSlice";

function Home() {
  const dispatch = useDispatch();
  const { totalUsers, activeUsers, revenue, loading } = useSelector(
    (state) => state.dashboard
  );

  useEffect(() => {
    dispatch(fetchDashboardStats());
    dispatch(fetchRevenue());
  }, [dispatch]);

  if (loading) {
    return <p style={{ padding: "20px" }}>Loading dashboard...</p>;
  }

  return (
    <div className="home">
      <p className="home-subtitle">Track performance, members & growth</p>
      <div className="stats">
        <div className="card">
          <h3>Total Members</h3>
          <p>{totalUsers}</p>
          <span className="card-note">+2 this month</span>
        </div>

        <div className="card">
          <h3>Active Members</h3>
          <p>{activeUsers}</p>
          <span className="card-note">Currently training</span>
        </div>

        <div className="card">
          <h3>Monthly Revenue</h3>
          <p>{revenue}</p>
          <span className="card-note">Subscriptions</span>
        </div>

        <div className="card">
          <h3>Trainers</h3>
          <p>18</p>
          <span className="card-note">Certified coaches</span>
        </div>
      </div>

      <div className="section">
        <h2>Today‚Äôs Attendance</h2>
        <div className="attendance">
          <div className="attendance-card">
            <h4>Morning Batch</h4>
            <p>124 Members</p>
          </div>
          <div className="attendance-card">
            <h4>Evening Batch</h4>
            <p>176 Members</p>
          </div>
          <div className="attendance-card">
            <h4>Personal Training</h4>
            <p>42 Sessions</p>
          </div>
        </div>
      </div>

      {/* Activity Section */}
      <div className="section">
        <h2>Recent Gym Activity</h2>
        <ul className="activity-list">
          <li>üí™ New member joined: Rahul Sharma</li>
          <li>üèãÔ∏è Trainer assigned to 5 members</li>
          <li>üî• HIIT batch fully booked</li>
          <li>üí≥ Monthly subscription renewed</li>
        </ul>
      </div>
    </div>
  );
}

export default Home;
